const PREVIEW_LOOKUP = {"0":{"t":"Netzwerkdienste überwachen (Aktive Checks) - Überwachung von HTTPS, TCP, SSH, FTP und weiteren Diensten","p":"Bei vielen Diensten ist es nur sinnvoll, diese von außen auf Funktion oder Antwortzeiten zu überwachen. Hier erfahren Sie, wie das in Checkmk funktioniert.","l":"active_checks.html"},"1":{"t":"Automatische Agenten-Updates - Agenten und Plugins automatisch verteilen","p":"In diesem Artikel erfahren Sie, wie Sie individuelle Installationspakete für Agenten erstellen und bei Bedarf auch automatisch verteilen.","l":"agent_deployment.html"},"2":{"t":"FreeBSD überwachen - Der Agent für FreeBSD im Detail","p":"Der FreeBSD-Agent ist ein einfaches Shell-Skript und damit maximal transparent. Wie Sie den Agenten nutzen, erweitern und konfigurieren, erfahren Sie hier.","l":"agent_freebsd.html"},"3":{"t":"Linux überwachen - Der neue Agent für Linux im Detail","p":"Der Linux-Agent der Checkmk-Version 2.1.0 ergänzt das Agentenskript mit dem Agent Controller und neuen Funktionen. Wie Sie den Agenten nutzen, erfahren Sie hier.","l":"agent_linux.html"},"4":{"t":"Linux überwachen im Legacy-Modus","p":"Der Linux-Agent kann im Legacy-Modus ohne Agent Controller betrieben werden, wenn er die Voraussetzungen für den verschlüsselten Pull-Modus nicht erfüllt.","l":"agent_linux_legacy.html"},"5":{"t":"Windows überwachen - Der neue Agent für Windows im Detail","p":"Der Windows-Agent der Checkmk-Version 2.1.0 ergänzt das Agentenprogramm mit dem Agent Controller und neuen Funktionen. Wie Sie den Agenten nutzen, erfahren Sie hier.","l":"agent_windows.html"},"6":{"t":"Alert Handler - Auf Probleme automatisiert reagieren","p":"Manche Probleme tauchen nur selten für kurze Zeit auf. Checkmk kann dann Alert Handler Skripte ausführen, um Informationen für die Analyse zu sammeln.","l":"alert_handlers.html"},"7":{"t":"Konfiguration der Checkmk Instanz analysieren","p":"Mit der Funktion ","l":"analyze_configuration.html"},"8":{"t":"Backup in der Appliance","p":"Anleitung zum Erstellen und Wiederherstellen von Datensicherungen in der Appliance.","l":"appliance_backup.html"},"9":{"t":"Appliance im Cluster-Betrieb","p":"Anleitung zum Betrieb eines Failover-Clusters.","l":"appliance_cluster.html"},"10":{"t":"Virtuelle Appliance installieren","p":"Mit der virtuellen Appliance wird die Einrichtung von Checkmk noch einfacher. Die Installation erfolgt durch Import in VirtualBox, Proxmox oder VMware ESXi.","l":"appliance_install_virt1.html"},"11":{"t":"Schnellstart-Anleitung für Checkmk-Racks","p":"Kurzanleitung für die Inbetriebnahme der physischen Checkmk-Appliance.","l":"appliance_rack1_quick_start.html"},"12":{"t":"Besonderheiten der Hardware-Appliance","p":"Anleitung zu spezifischen Aspekten der physischen Appliance.","l":"appliance_rack_config.html"},"13":{"t":"Appliance einrichten und nutzen","p":"Anleitung zur Einrichtung der physischen und virtuellen Checkmk Appliances.","l":"appliance_usage.html"},"14":{"t":"Schnellstart-Anleitung für Checkmk virt1","p":"Kurzanleitung für die Inbetriebnahme der virtuellen Checkmk-Appliance.","l":"appliance_virt1_quick_start.html"},"15":{"t":"Verfügbarkeit (Availability) - Verfügbarkeiten auswerten und beurteilen","p":"Checkmk berechnet nach Bedarf die Verfügbarkeit eines Objekts, seitdem es ihm bekannt ist. Erfahren Sie hier alles darüber, wie sie Auswertungen benutzen.","l":"availability.html"},"16":{"t":"Backups - Daten sichern und wiederherstellen","p":"In diesem Artikel erfahren Sie, wie Sie die Daten einer Checkmk-Instanz sichern und per Restore wiederherstellen.","l":"backup.html"},"17":{"t":"Die Bakery-API","p":"Die Bakery-API bietet eine Schnittstelle, um Agentenpakete der Agentenbäckerei zu erweitern, z.B. mit Agentenplugins und deren Konfiguration.","l":"bakery_api.html"},"18":{"t":"Quittierung von Problemen - Neue Probleme von solchen in Bearbeitung unterscheiden","p":"Probleme sind selten sofort behoben, sobald sie erkannt sind. Lernen Sie hier, wie Sie in Checkmk Probleme bestätigen und wie Sie Bestätigungen in der GUI finden.","l":"basics_ackn.html"},"19":{"t":"Wartungszeiten","p":"Geplante Ausfälle müssen im Monitoring berücksichtigt werden. Wie Wartungszeiten in Checkmk abgebildet werden können, erfahren Sie hier.","l":"basics_downtimes.html"},"20":{"t":"Business Intelligence (BI) - Komplexität mit der BI reduzieren","p":"Mit der Business Intelligence (BI) können Sie komplexe Zusammenhänge einfach darstellen. Lernen Sie hier Schritt für Schritt, BIs regelbasiert und dynamisch zu erstellen.","l":"bi.html"},"21":{"t":"Die Cloud Edition","p":"Was die Cloud Edition ausmacht, vor allem auch im Vergleich zu den anderen Checkmk-Editionen, erfahren Sie hier.","l":"cce.html"},"22":{"t":"Cluster-Services überwachen","p":"Checkmk hilft Ihnen dabei, für eine Gruppe vernetzter Hosts mit der gleichen Aufgabe ein Cluster einzurichten und die Cluster-Services für das Monitoring auszuwählen.","l":"clustered_services.html"},"23":{"t":"Der Checkmk Micro Core","p":"Alles über den spezifischen Checkmk Micro Core (CMC) und seine Vorteile erfahren Sie in diesem Artikel.","l":"cmc.html"},"24":{"t":"Besonderheiten des CMC","p":"Der Checkmk Micro Core (CMC) unterscheidet sich an einigen Stellen von anderen Nagios-kompatiblen Kernen. Diese werden hier ausführlich beschrieben.","l":"cmc_differences.html"},"25":{"t":"Dateien und Verzeichnisse des CMC","p":"Diese Übersicht stellt alle wichtigen Dateien und Verzeichnisse zusammen, die den Checkmk Micro Core (CMC) betreffen.","l":"cmc_files.html"},"26":{"t":"Migration auf den CMC - Von Nagios zum Checkmk Micro Core wechseln","p":"Alles, was Sie für die Migration vom Nagios Kern zum Checkmk Micro Core (CMC) wissen müssen, enthält dieser Artikel.","l":"cmc_migration.html"},"27":{"t":"Checkmk auf der Kommandozeile - Kommandozeilenbefehle verstehen und nutzen","p":"Wenn Sie Checkmk auf der Kommandozeile nutzen wollen, finden Sie hier die wichtigsten Befehle (z.B. cmk) und die zugehörigen Dateien und Verzeichnisse.","l":"cmk_commandline.html"},"28":{"t":"Checkmk-Versionen","p":"Die Checkmk Softwareentwicklung führt von Tagesversionen, Innovation-Versionen, Beta-Versionen bis hin zur stabilen Version - für die es aktiven und passiven Support gibt.","l":"cmk_versions.html"},"29":{"t":"Kommandos","p":"Lernen Sie hier, wie Sie mit Checkmk im Monitoring gezielt Aktionen auf Hosts oder Services per Kommando ausführen.","l":"commands.html"},"30":{"t":"Copyright-Hinweise","p":"Hinweise zu den Rechten an Texten und Grafiken im Checkmk Handbuch","l":"copyright.html"},"31":{"t":"Die Standard Edition","p":"Die unterschiedlichen Checkmk-Editionen bieten einen unterschiedlichen Feature-Umfang. Dieser Artikel erklärt die Standard Edition.","l":"cse.html"},"32":{"t":"Anmerkungen (Custom notes) - zu Hosts und Services","p":"In den Ansichten zu Hosts und Services können Anmerkungen hinterlegt werden. Lernen Sie hier, wie Sie diese Anmerkungen in Checkmk einrichten.","l":"custom_notes.html"},"33":{"t":"Dashboards","p":"Checkmk-Dashboards sind extrem flexibel und passen sich automatisch dem verfügbaren Platz an. Lesen Sie hier, wie Sie Dashboards interpretieren und erstellen.","l":"dashboards.html"},"34":{"t":"Datenquellenprogramme - Geräte ohne direkten Agentenzugriff überwachen","p":"Mit Datenquellenprogrammen werden Hosts überwacht, welche nicht direkt oder nur über eine API erreichbar sind. Grundlegende Informationen zur Funktion werden hier beschrieben.","l":"datasource_programs.html"},"35":{"t":"Dynamische Host-Konfiguration - Überwachen von dynamischen Infrastrukturen","p":"Checkmk kann flüchtige Infrastrukturen durch dynamisches Hinzufügen und Löschen von Hosts in einem vollautomatischen Verfahren verwalten.","l":"dcd.html"},"36":{"t":"Richtlinien für Check-Plugins","p":"Check-Plugins, die in die offizielle Checkmk-Software übernommen werden sollen, müssen bestimmte Vorraussetzungen erfüllen, die Sie hier gesammelt finden.","l":"dev_guidelines.html"},"37":{"t":"Agentenbasierte Check-Plugins schreiben","p":"Hier erfahren Sie, wie Sie agentenbasierte Checkmk-Plugins entwickeln können - mit allem was dazugehört, insbesondere mit der in der Version 2.0.0 neu entwickelten Check-API.","l":"devel_check_plugins.html"},"38":{"t":"SNMP-basierte Check-Plugins schreiben","p":"Hier erfahren Sie, wie Sie Check-Plugins für SNMP mithilfe der Check-API entwickeln und in Checkmk nutzen können.","l":"devel_check_plugins_snmp.html"},"39":{"t":"Erweiterungen für Checkmk entwickeln","p":"Hier erfahren Sie, mit welchen Methoden und Programmiersprachen Sie Erweiterungen für Checkmk entwickeln können.","l":"devel_intro.html"},"40":{"t":"Verteiltes Monitoring - Checkmk skalieren und verteilen","p":"Hier erfahren Sie, wie Sie mit Checkmk ein verteiltes Monitoring mit einer Zentralinstanz und mehreren Remote-Instanzen einrichten können.","l":"distributed_monitoring.html"},"41":{"t":"Die Event Console - Logs und SNMP-Traps in Checkmk verarbeiten","p":"Egal, ob Syslog, weitergeleitete Text-Logs oder Traps über SNMP - hier erfahren Sie, wie Sie diese Ereignisse in der Checkmk Event Console verarbeiten können.","l":"ec.html"},"42":{"t":"Vorhersagegraphen erstellen","p":"Mit den Vorhersagegraphen von Checkmk verbessern Sie ihr Capacity Management. Details zur Konfiguration erfahren Sie hier.","l":"forecast_graphs.html"},"43":{"t":"Glossar","p":"Glossar mit den wichtigsten Checkmk-spezifischen Begriffen.","l":"glossar.html"},"44":{"t":"Checkmk in Grafana integrieren","p":"Grafana-Dashboards mit Daten aus dem Checkmk-Monitoring können Sie leicht erstellen mit dem Checkmk-Plugin für Grafana.","l":"grafana.html"},"45":{"t":"Messwerte und Graphing - Messwerte in Checkmk schnell und einfach auswerten","p":"Checkmk bietet viele umfangreiche Metriken zum Darstellen, Kombinieren und Exportieren. Wichtiges Hintergrundwissen finden Sie am Ende des Artikels.","l":"graphing.html"},"46":{"t":"Host-Merkmale","p":"Mit Host-Merkmalen (host tags), Merkmalsgruppen und Hilfsmerkmalen können Sie Ordner und Hosts nach Ihren Wünschen strukturieren.","l":"host_tags.html"},"47":{"t":"Automatisch Hosts erstellen","p":"Checkmk-Instanz und -Agent können so vorbereitet werden, dass Hosts automatisch erstellt werden. Die Einrichtung beschreibt dieser Artikel.","l":"hosts_autoregister.html"},"48":{"t":"Verwaltung der Hosts – Die zu überwachenden Systeme verwalten","p":"Welche Möglichkeiten Checkmk bietet, Hosts zu erstellen, mit Ordnern zu strukturieren und zu pflegen, erfahren Sie hier.","l":"hosts_setup.html"},"49":{"t":"Strukturierung der Hosts","p":"Skalierbarkeit gehört zum Grunddesign von Checkmk. Welche Möglichkeiten es gibt, Hosts zu strukturieren, erfahren Sie hier.","l":"hosts_structure.html"},"50":{"t":"Das offizielle Checkmk Handbuch","p":"Mit dem Checkmk Handbuch setzen Sie im Handumdrehen ein umfassendes Monitoring auf. Fortgeschrittene Benutzer können damit das Beste aus ihrem Monitoring herausholen.","l":"index.html"},"51":{"t":"Installation von Checkmk in der Appliance","p":"Anleitung zur Installation von Checkmk in der virtuellen und physischen Appliance","l":"install_appliance_cmk.html"},"52":{"t":"Installation aus dem AWS Marketplace","p":"Checkmk bietet ein (fast) schlüsselfertiges Image im AWS Marketplace. In diesem Artikel erfahren Sie, wie Sie die Einrichtung abschließen.","l":"install_aws.html"},"53":{"t":"Installation aus dem Azure Marketplace","p":"Checkmk bietet ein (fast) schlüsselfertiges Image im Azure Marketplace. In diesem Artikel erfahren Sie, wie Sie die Einrichtung abschließen.","l":"install_azure.html"},"54":{"t":"Grundsätzliches zur Installation von Checkmk","p":"Jede Linux-Distribution (RHEL-basiert, SLES, Debian und Ubuntu) hat ihre Besonderheiten, die bei der Installation von Checkmk zu beachten sind.","l":"install_packages.html"},"55":{"t":"Installation unter Debian und Ubuntu","p":"Hier erfahren Sie, wie Sie Checkmk unter der Linux-Distribution von Debian und von Ubuntu installieren.","l":"install_packages_debian.html"},"56":{"t":"Installation unter Red Hat und Derivaten","p":"Hier erfahren Sie, wie Sie Checkmk unter der Linux-Distribution Red Hat Enterprise Linux (RHEL) und ihren Derivaten installieren.","l":"install_packages_redhat.html"},"57":{"t":"Installation unter SUSE Linux Enterprise Server","p":"Hier erfahren Sie, wie Sie Checkmk unter der Linux-Distribution von SUSE Linux Enterprise Server (SLES) installieren.","l":"install_packages_sles.html"},"58":{"t":"Datadog integrieren","p":"Monitore und Events aus Datadog können in Checkmk integriert werden.","l":"integrating_datadog.html"},"59":{"t":"Best Practices, Tipps & Tricks","p":"Bewährte Vorgehensweisen vermeiden Probleme in Checkmk, z.B. bei der Überwachung von Windows-Diensten, der Internetverbindung oder HTTP/HTTPS-Diensten.","l":"intro_bestpractise.html"},"60":{"t":"Das Monitoring weiter ausbauen","p":"Beispiele für die Erweiterung Checkmk nach der Einrichtung sind: Optimierung der Sicherheit, Überwachung sehr großer Umgebungen und Business Intelligence (BI).","l":"intro_extend.html"},"61":{"t":"Das Monitoring feinjustieren","p":"Regeln und Host-Merkmale sind wichtige und mächtige Werkzeuge für die Konfiguration und um eine ganze Reihe von Fehlalarmen in Checkmk zu vermeiden.","l":"intro_finetune.html"},"62":{"t":"Die Checkmk-Oberfläche","p":"Wichtige Bestandteile der grafischen Benutzeroberfläche (GUI) von Checkmk sind Navigationsleiste, Hauptseite und Seitenleiste.","l":"intro_gui.html"},"63":{"t":"Checkmk im Monitoring","p":"Probleme zu quittieren und Wartungszeiten einzurichten sind wichige Aufgaben im Monitoring mit Checkmk.","l":"intro_monitor.html"},"64":{"t":"Benachrichtigungen einschalten","p":"Für Benachrichtigungen in Checkmk muss der Versand per E-Mail vorbereitet und aktiviert werden. Anschließend werden Benachrichtigungen getestet.","l":"intro_notifications.html"},"65":{"t":"Checkmk aufsetzen","p":"Beim Aufsetzen von Checkmk geht es um die Auswahl der passenden Edition und Version, Software-Installation, Erstellung einer Instanz und die erste Anmeldung.","l":"intro_setup.html"},"66":{"t":"Das Monitoring einrichten","p":"Um Checkmk für das Monitoring einzurichten, muss der erste Host aufgenommen, seine Services konfiguriert und die Änderungen aktiviert werden.","l":"intro_setup_monitor.html"},"67":{"t":"Die Monitoring-Werkzeuge","p":"Wichtige Werkzeuge für das Monitoring mit Checkmk sind die Snapins der Statusleiste, wie z.B. Overview und Master control.","l":"intro_tools.html"},"68":{"t":"Mit mehreren Benutzern arbeiten","p":"Der Verantwortungsbereich eines Benutzers wird in Checkmk festgelegt durch die Zuweisung von Rollen für Berechtigungen und Kontaktgruppen für Zuständigkeiten.","l":"intro_users.html"},"69":{"t":"Installation als Docker-Container","p":"Die Installation von Checkmk in einem Docker-Container ist mit dem offiziellen Image sehr einfach. Die sinnvollen Optionen dabei werden hier näher beschrieben.","l":"introduction_docker.html"},"70":{"t":"Die HW/SW-Inventur","p":"Mit der HW/SW-Inventur ermitteln Sie auf den von Checkmk überwachten Hosts die Hardwareausstattung, die installierte Software und mehr.","l":"inventory.html"},"71":{"t":"Single Sign-On mit Kerberos","p":"Single Sign-On (SSO) ist kein offizielles Feature von Checkmk, trotzdem erfahren Sie in diesem Artikel, wie Sie SSO mit Kerberos in Checkmk integrieren.","l":"kerberos.html"},"72":{"t":"Labels","p":"In diesem Artikel erfahren Sie, wie Sie in Checkmk mit Host- und Service-Labels bekannte Strukturierungsmarker aus anderen Umgebungen nutzen können.","l":"labels.html"},"73":{"t":"Benutzerverwaltung mit LDAP/Active Directory","p":"Benutzer und Kontaktgruppen können in Checkmk auch über LDAP oder Microsofts Active Directory (AD) synchronisiert werden.","l":"ldap.html"},"74":{"t":"Lizenzen verwalten - Lizenzinformationen sammeln und übermitteln","p":"Wie Sie in Checkmk die Lizenzierung der Software abwickeln und Information über den aktuellen Lizenzstatus sammeln und übermitteln, erfahren Sie in diesem Artikel.","l":"license.html"},"75":{"t":"Statusdaten abrufen via Livestatus","p":"Livestatus ist die Schnittstelle, um direkten Zugriff auf alle Daten der überwachten Objekte zu haben. Dieser Artikel führt in die Nutzung der API ein.","l":"livestatus.html"},"76":{"t":"Livestatus Befehlsreferenz","p":"Die Livestatus Referenz enthält Tabellen, Filter und Operatoren zum Nachschlagen und ergänzt damit den einführenden Artikel zur Livestatus-API.","l":"livestatus_references.html"},"77":{"t":"Lokale Checks","p":"Checkmk kann auch ohne große Programmierkenntnis sehr einfach erweitert werden. Erfahren Sie hier, wie Sie dem Agenten ein eigenes Skript übergeben.","l":"localchecks.html"},"78":{"t":"Die Managed Services Edition - Checkmk als Dienstleistung anbieten","p":"Mit der Checkmk Managed Services Edition können Sie über das verteilte Monitoring voneinander abgeschottete Instanzen für mehrere Kunden betreiben.","l":"managed.html"},"79":{"t":"Checkmk-Server im Docker-Container","p":"Nach dem Start eines Docker-Containers folgt seine Pflege. Dieser Artikel beschreibt, welche Besonderheiten dabei zu beachten sind.","l":"managing_docker.html"},"80":{"t":"Metriken senden an InfluxDB und Graphite - über die InfluxDB v2 API oder das Carbon-Plaintext-Protokoll","p":"Die in Checkmk gespeicherten Metriken können an die Metrikdatenbanken von InfluxDB und Graphite gesendet und dort weiterverarbeitet werden.","l":"metrics_exporter.html"},"81":{"t":"Dateien überwachen","p":"In Checkmk können Sie mit mk_filestats und fileinfo Dateien bezüglich Alter, Größe und Anzahl überwachen, sowohl unter Linux als auch unter Windows.","l":"mk_filestats.html"},"82":{"t":"MKPs für GUI-Erweiterungen - Checkmk-Erweiterungspakete für Dashboards, Ansichten, Berichte","p":"Dashboards, Ansichten und Berichte lassen sich ganz einfach paketieren und mit anderen teilen - auch über die Checkmk Exchange.","l":"mkp_viewables.html"},"83":{"t":"Checkmk-Erweiterungspakete (MKPs)- Erweiterungen der Community in Checkmk integrieren","p":"Von der Checkmk Community erstellte Erweiterungen können über Pakete einfach erstellt und mit anderen geteilt werden.","l":"mkps.html"},"84":{"t":"Amazon Web Services (AWS) überwachen","p":"Wie Sie ohne Agent Amazon S3, EC2, EBS, RDS und ELB oder ihre Kosten überwachen und nahtlos in Checkmk integrieren, wird hier beschrieben.","l":"monitoring_aws.html"},"85":{"t":"Microsoft Azure überwachen","p":"Die Integration von Microsoft Azure in Checkmk ermöglicht die nahtlose Überwachung von Cloud und On-Premises in einer Oberfläche und wird hier im Detail beschrieben.","l":"monitoring_azure.html"},"86":{"t":"Grundlagen des Monitorings mit Checkmk - Begriffe in Checkmk verstehen","p":"In diesem Artikel werden grundlegende Begriffe und Konzepte in Checkmk erläutert, wie z.B. Host, Service, Benutzer, Kontaktgruppe, Benachrichtigung, Zeitraum, Wartungszeit.","l":"monitoring_basics.html"},"87":{"t":"Docker überwachen","p":"Der Artikel beschreibt, wie Sie ein vollständiges Monitoring für Docker-Nodes und deren Container in Checkmk betreiben und was Sie dabei beachten müssen.","l":"monitoring_docker.html"},"88":{"t":"Google Cloud Platform (GCP) überwachen","p":"Wie Sie ohne Agent Google Cloud Run, Cloud SQL, Cloud Functions, GCE, GCS und Memorystore/Redis oder ihre Kosten überwachen und nahtlos in Checkmk integrieren, wird hier beschrieben.","l":"monitoring_gcp.html"},"89":{"t":"Zeitbasierte Prozesse (Cronjobs) überwachen","p":"Lernen Sie, wie sie die korrekte und erfolgreiche Ausführung von zeitbasierten Prozessen - Cronjobs - mit Checkmk überwachen können.","l":"monitoring_jobs.html"},"90":{"t":"Kubernetes überwachen","p":"Mit Checkmk können Sie auch die Container-Orchestrierungssoftware Kubernetes überwachen. Lesen Sie hier die Details zur Einrichtung.","l":"monitoring_kubernetes.html"},"91":{"t":"Log-Dateien überwachen","p":"In Checkmk können Sie mit mk_logwatch Log-Dateien auf bestimmte Inhalte prüfen und überwachen.","l":"monitoring_logfiles.html"},"92":{"t":"MSSQL überwachen","p":"Mit dem Checkmk-Plugin für Windows, Linux, Solaris und AIX überwachen Sie vollumfänglich Microsoft SQL.","l":"monitoring_mssql.html"},"93":{"t":"MySQL überwachen","p":"Mit dem Checkmk Plugin für Windows, Linux, Solaris und AIX überwachen Sie vollumfänglich MySQL.","l":"monitoring_mysql.html"},"94":{"t":"OpenShift überwachen","p":"Mit Checkmk können Sie auch die OpenShift Container Platform überwachen. Lesen Sie hier die Details zur Einrichtung.","l":"monitoring_openshift.html"},"95":{"t":"Oracle-Datenbanken überwachen","p":"Mit dem Agentenplugin fÜr Windows, Linux, Solaris und AIX überwachen Sie vollumfänglich Oracle-Datenbanken. Details zur Konfiguration erfahren Sie hier.","l":"monitoring_oracle.html"},"96":{"t":"Prometheus integrieren","p":"Prometheus kann in Checkmk integriert werden, um schnelllebige Containerumgebungen zu überwachen.","l":"monitoring_prometheus.html"},"97":{"t":"VMware ESXi überwachen","p":"Mit Checkmk können Sie ein vCenter, seine ESXi-Hosts und auch die virtuellen Maschinen (VMs) ohne extra Agenten überwachen.","l":"monitoring_vmware.html"},"98":{"t":"Nagstamon mit Checkmk verbinden","p":"Nagstamon ist ein Tool für Administratoren, um auf dem Desktop auch ohne Browser Probleme sofort zu sehen. Diese Anleitung hilft bei der Anbindung an Checkmk.","l":"nagstamon.html"},"99":{"t":"NagVis: Statusdaten auf Karten und Diagrammen","p":"Das Open-Source-Tool NagVis ist fester Bestandteil von Checkmk. Dieser Artikel bietet einen idealen Einstieg in NagVis und dessen Integration in Checkmk.","l":"nagvis.html"},"100":{"t":"Benachrichtigungen (notifications) - per E-Mail, SMS, Ticketsystem und mehr","p":"Um Benachrichtigungen zu konfigurieren, sind Zeitpunkt, Methode und die Gruppe der Empfänger essentiell. Lernen Sie hier, wie Sie Ihre Anforderungen in Checkmk umsetzen.","l":"notifications.html"},"101":{"t":"Benachrichtigungen per ilert (notifications)","p":"Sie können Benachrichtigungen von Checkmk an die Plattform ilert senden lassen. Wie Sie die Anbindung durchführen, erfahren Sie hier.","l":"notifications_ilert.html"},"102":{"t":"Benachrichtigungen per Jira (notifications)","p":"Sie können Benachrichtigungen von Checkmk an Jira senden lassen und damit Jira Issues erstellen und schließen. Wie Sie die Anbindung durchführen, erfahren Sie hier.","l":"notifications_jira.html"},"103":{"t":"Benachrichtigungen per Mattermost (notifications)","p":"Sie können Benachrichtigungen von Checkmk an den Open Source Instant-Messaging-Dienst Mattermost senden lassen. Wie Sie die Anbindung durchführen, erfahren Sie hier.","l":"notifications_mattermost.html"},"104":{"t":"Benachrichtigungen per Opsgenie (notifications)","p":"Sie können Benachrichtigungen von Checkmk an die Incident-Management-Plattform Opsgenie senden lassen. Wie Sie die Anbindung durchführen, erfahren Sie hier.","l":"notifications_opsgenie.html"},"105":{"t":"Benachrichtigungen per PagerDuty (notifications)","p":"Sie können Benachrichtigungen von Checkmk an die Incident-Management-Plattform PagerDuty senden lassen. Wie Sie die Anbindung durchführen, erfahren Sie hier.","l":"notifications_pagerduty.html"},"106":{"t":"Benachrichtigungen per Pushover (notifications)","p":"Sie können Benachrichtigungen von Checkmk über den Dienst Pushover an Apple- und Android-Mobilgeräte senden lassen. Wie Sie die Anbindung durchführen, erfahren Sie hier.","l":"notifications_pushover.html"},"107":{"t":"Benachrichtigungen per ServiceNow (notifications)","p":"Sie können Benachrichtigungen von Checkmk an das Incident-Management-System ServiceNow senden lassen. Wie Sie die Anbindung durchführen, erfahren Sie hier.","l":"notifications_servicenow.html"},"108":{"t":"Benachrichtigungen per Slack (notifications)","p":"Sie können Benachrichtigungen von Checkmk an den Instant-Messaging-Dienst Slack senden lassen. Wie Sie die Anbindung durchführen, erfahren Sie hier.","l":"notifications_slack.html"},"109":{"t":"Benachrichtigungen per Spunk On-Call","p":"Sie können Benachrichtigungen von Checkmk an die Incident-Management-Plattform Splunk On-Call senden lassen. Wie Sie die Anbindung durchführen, erfahren Sie hier.","l":"notifications_splunkoncall.html"},"110":{"t":"Benachrichtigungen per Microsoft Teams (notifications)","p":"Sie können Benachrichtigungen von Checkmk an Microsoft-Teams-Kanäle senden lassen. Wie Sie die Anbindung durchführen, erfahren Sie hier.","l":"notifications_teams.html"},"111":{"t":"Benachrichtigungen per Cisco Webex Teams (notifications)","p":"Sie können Benachrichtigungen von Checkmk an Cisco Webex Teams senden lassen. Wie Sie die Anbindung durchführen, erfahren Sie hier.","l":"notifications_webex.html"},"112":{"t":"ntopng in Checkmk integrieren - Checkmk an eine ntop-Lösung anbinden","p":"Mit der Integration von ntopng erweitern Sie die Funktionen von Checkmk um das Monitoring der Netzwerkdatenflüsse und die tiefgehende Analyse des Netzwerkverkehrs.","l":"ntop.html"},"113":{"t":"Instanzen (Sites) mit omd verwalten","p":"Checkmk ermöglicht mit dem Befehl omd die Verwaltung von beliebig vielen Monitoring-Instanzen (monitoring sites) und Software-Versionen auf einem Server.","l":"omd_basics.html"},"114":{"t":"Weboberfläche mit HTTPS absichern","p":"Aus Sicherheitsgründen sollten Weboberflächen nur über HTTPS betrieben werden. Hier erfahren Sie, wie Sie die Verschlüsselung für eine Checkmk-Instanz aktivieren.","l":"omd_https.html"},"115":{"t":"Passwortspeicher (Password store)","p":"Dieser Artikel zeigt, wie Sie Passwörter zum Zugriff auf ferne Systeme im Checkmk-Passwortspeicher ablegen und von dort nutzen können.","l":"password_store.html"},"116":{"t":"Der Piggyback-Mechanismus","p":"Hier erfahren Sie, wie Sie mit Checkmk Monitoring-Daten eines Hosts beim Abfragen eines anderen Hosts huckepack (piggyback) mit übertragen.","l":"piggyback.html"},"117":{"t":"Ports - Von Checkmk genutzte Ports","p":"Checkmk nutzt für die Kommunikation einige Ports, die freigegeben sein müssen. Welche das sind, erfahren Sie hier.","l":"ports.html"},"118":{"t":"Prognosebasiertes Monitoring","p":"Prognosebasiertes Monitoring berechnet aus Messdaten der Vergangenheit eine Vorhersage, wie sich ein Service in Checkmk in Zukunft verhalten wird.","l":"predictive_monitoring.html"},"119":{"t":"Reguläre Ausdrücke in Checkmk - Checkmk mit Text-Mustern konfigurieren","p":"An vielen Stellen gibt es die Möglichkeit, über reguläre Ausdrücke eine Gruppe an Objekten zu erfassen. Erst dadurch wird eine hohe Dynamik ermöglicht.","l":"regexes.html"},"120":{"t":"Release notes - Versionshinweise für Checkmk 2.2.0","p":"Checkmk 2.2.0 funktioniert mit einer Reihe von Plattformen und Integrationen, die während der aktiven Pflege im Produkt-Lifecycle unterstützt werden.","l":"release_notes.html"},"121":{"t":"Linux-Upgrade auf dem Checkmk-Server","p":"Was es beim Release-Upgrade der Linux-Distribution auf dem Checkmk-Server zu beachten gibt, erfahren Sie in diesem Artikel.","l":"release_upgrade.html"},"122":{"t":"Berichte (Reports)","p":"Checkmk kann Berichte (Reports) nicht nur automatisiert/ad hoc erstellen, sondern diese auch direkt verschicken. Lernen Sie hier, wie Sie diese Funktion nutzen.","l":"reporting.html"},"123":{"t":"Die Checkmk REST-API","p":"Mit der Checkmk REST-API können Sie Aufgaben, die Sie sonst über die GUI erledigen, per HTTP-Anfragen vom Checkmk-Server ausführen lassen.","l":"rest_api.html"},"124":{"t":"Anmeldung mit SAML","p":"Checkmk kann in eine Single-Sign-On-Lösung (SSO) eingebunden werden. Lesen Sie hier, wie Sie die Authentifizierung mit SAML einrichten.","l":"saml.html"},"125":{"t":"Suchen in docs.checkmk.com - Die Suche optimal nutzen","p":"docs.checkmk.com nutzt eine Lunr-basierte Suche, die schnell ist und viele Konfigurationsmöglichkeiten bietet. Welche dies sind, erfahren Sie hier.","l":"search.html"},"126":{"t":"Sicherheit (Security) - Checkmk zusätzlich absichern","p":"Checkmk ist bereits per Design sehr sicher. Mit welchen Maßnahmen Sie ihr Monitoring noch sicherer machen können, erfahren Sie in diesem Artikel.","l":"security.html"},"127":{"t":"Der Simulationsmodus - Daten in Checkmk simulieren","p":"Um Checkmk ohne Netzwerkzugriff zu testen, können Sie mit Daten aus dem Cache den Betrieb simulieren. Wie das funktioniert, wird hier beschrieben.","l":"simulation_mode.html"},"128":{"t":"Erweiterte Verfügbarkeiten (SLAs) - SLAs konfigurieren und auswerten","p":"Service Level Agreements (SLAs) sind oft nicht über eine einfache Verfügbarkeit abbildbar. Dieser Artikel erklärt, wie Sie komplexe SLAs konfigurieren und nutzen.","l":"sla.html"},"129":{"t":"Überwachen via SNMP - Monitoring von SNMP-Geräten mit Checkmk","p":"Checkmk unterstützt Sie flexibel bei der Überwachung aller möglichen Geräte mit SNMP. Hier erfahren Sie, wie SNMP funktioniert und wie Sie es in Checkmk nutzen.","l":"snmp.html"},"130":{"t":"Das Spool-Verzeichnis - Dateiinhalte der Agentenausgabe hinzufügen","p":"Im Spool-Verzeichnis können regelmäßig laufende Programme Informationen zu ihrem Zustand ablegen, die dann in die Agentenausgabe übernommen werden.","l":"spool_directory.html"},"131":{"t":"Support Diagnostics - Diagnoseinformationen sammeln","p":"Sie können an zentraler Stelle Diagnoseinformationen für die Fehleranalyse auswählen und sammeln, um diesen Dump später an den Checkmk-Support zu senden.","l":"support_diagnostics.html"},"132":{"t":"Zeitperioden (Time Periods) - Aktionen auf bestimmte Tageszeiten beschränken","p":"Mit Zeitperioden können gängige Einschränkungen, wie Arbeits- oder Servicezeiten und anderes abgebildet werden. Wie das funktioniert, erfahren Sie hier.","l":"timeperiods.html"},"133":{"t":"Updates und Upgrades","p":"Egal, ob Raw Edition oder eine der kommerziellen Editionen: Checkmk zu aktualisieren ist so einfach, wie möglich. Die Prinzipien dazu werden hier erklärt.","l":"update.html"},"134":{"t":"Update auf Version 2.2.0","p":"Was es beim Update von Checkmk Version 2.1.0 auf 2.2.0 zu beachten gibt, erfahren Sie in diesem Artikel.","l":"update_major.html"},"135":{"t":"Update-Matrix für Version 2.2.0","p":"Dieser Artikel zeigt die von Checkmk unterstützten Linux-Distributionsversionen. So können Sie die Reihenfolge ermitteln, um Checkmk auf Ihrem Linux-Server zu aktualisieren.","l":"update_matrix.html"},"136":{"t":"Die Benutzeroberfläche","p":"Nach der Anmeldung landet man auf der Startseite von Checkmk. Die wichtigsten Elemente werden hier vorgestellt: Navigationsleiste, Hauptseite, Seitenleiste.","l":"user_interface.html"},"137":{"t":"Ansichten von Hosts und Services (Views)","p":"Tabellenansichten sind in Checkmk sehr mächtig und können indiviuell erstellt oder angepasst werden. Wie Sie Ansichten effektiv nutzen, erfahren Sie hier.","l":"views.html"},"138":{"t":"Die Konfiguration von Checkmk","p":"Checkmk ermöglicht die gesamte Basiskonfiguration direkt in der Weboberfläche. Dieser Artikel bietet einen ersten Einstieg in die Konfigurationsumgebung.","l":"wato.html"},"139":{"t":"Monitoring-Agenten - Mit Checkmk Geräte im Netzwerk überwachen","p":"Hier bekommen Sie einen schnellen Überblick, mit welchen Methoden Server, Switche und andere Geräte überwacht werden können und wie der Agent funktioniert.","l":"wato_monitoringagents.html"},"140":{"t":"Regeln","p":"Regeln in Checkmk können den Standard oder die Ausnahme definieren. Dieser Artikel beschreibt detailliert die Nutzung von Regeln und wie sie ausgewertet werden.","l":"wato_rules.html"},"141":{"t":"Services verstehen und konfigurieren - Elemente eines Hosts erkennen und überwachen","p":"Services bilden den Kern eines jeden überwachten Hosts. Sie werden automatisch erfasst und können umfangreich konfiguriert und strukturiert werden.","l":"wato_services.html"},"142":{"t":"Benutzer, Zuständigkeiten, Berechtigungen - Die Konfiguration für Benutzer und Autorisierung","p":"Jedes überwachte Objekt hat einen Zuständigen. Hier erfahren Sie, was Rollen und Kontaktgruppen sind, und alles andere, was für die Benutzerverwaltung wichtig ist.","l":"wato_user.html"},"143":{"t":"Willkommen im Checkmk Handbuch","p":"Jedes Handbuch erfodert eine bestimmte Nutzung. Hier wird erklärt, wie das Handbuch zu Checkmk aufgebaut ist, damit Sie die relevanten Inhalte schnell finden.","l":"welcome.html"}};